import React from "react";
import "./Feed.css";
import Workplace from "../Workplace/Workplace";
import Header from "../Workplace/Header";

function Feed() {
    return (
        <div>
            <Header />
            <Workplace />
            <div className="feed">
                <h2>My works</h2>
            </div>
        </div>
    );
}

export default Feed;
